    checkSessionIDLeak(cookie) {
        /** Checks for sessionID data being leaked, which can put user at risk of session hijacking attacks
         * 
         * https://owasp.org/www-project-web-security-testing-guide/latest/4-Web_Application_Security_Testing/06-Session_Management_Testing/01-Testing_for_Session_Management_Schema
         * https://cheatsheetseries.owasp.org/cheatsheets/Session_Management_Cheat_Sheet.html
         */

        // Common sessionID names from https://wiki.owasp.org/index.php/Category:OWASP_Cookies_Database
        const sessionIDNames = ['session_id', 'id', 'sid', 'sessionID', 'JSESSIONID', 'ASPSESSIONIDXXXXXXXX', 'ASPSESSIONID', 'ASP.NET_SessionId', 'PHPSESSION', 'wiki18_session', 'WebLogicSession', 'BIGipServerxxx_xxx_xxx_PROTO', 'SERVERID', 'SaneID', 'ssuid', 'vgnvisitor', 'SESSION_ID', 'NSES40Session', 'iPlanetUserId', 'gx_session_id_', 'JROUTE', 'RMID', 'JSESSIONID', 'Apache', 'CFID', 'CFTOKEN', 'CFGLOBALS', 'RoxenUserID', 'JServSessionIdroot', 'sesessionid', 'PD-S-SESSION-ID', 'PD_STATEFUL', 'WEBTRENDS_ID', '__utmX', 'sc_id', 's_sq', 's_sess', 's_vi_XXXXXX', 'MintUnique', 'MintXXXX', 'SS_X_CSINTERSESSIONID', 'CSINTERSESSIONID', '_sn', 'BCSI-CSCXXXXXXX', 'Ltpatoken', 'Ltpatoken2', 'LtpatokenExpiry', 'LtpatokenUsername', 'DomAuthSessID', 'connect.sid'];

        if(!cookie.session) {
            return 0;   // return if not a session cookie
        }

        const cookieFields = Object.keys(cookie);
        return sessionIDNames.some(name => cookieFields.includes(name));
    }
